import React from "react";
import Container from "@material-ui/core/Container";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";

function Main() {
  return (
    <main class="main">
      <Container fixed>
        <Paper>
          <Grid container spacing={3}>
            <Grid item xs={6}>
              Somaer
            </Grid>
            <Grid item xs={6}>
              Somaer
            </Grid>
          </Grid>
        </Paper>
      </Container>
    </main>
  );
}

export default Main;
